import React, { useState } from 'react';
import '../styles/CommunityPage.css';

const CommunityPage = () => {
  const [friends] = useState([
    { id: 1, name: 'Maria Schmidt', profilePic: 'https://via.placeholder.com/50' },
    { id: 2, name: 'Thomas Weber', profilePic: 'https://via.placeholder.com/50' },
    { id: 3, name: 'Laura M√ºller', profilePic: 'https://via.placeholder.com/50' },
    { id: 4, name: 'Michael Wagner', profilePic: 'https://via.placeholder.com/50' }
  ]);

  const [groups] = useState([
    { id: 1, name: 'Fahrradfreunde Berlin', active: true },
    { id: 2, name: '√ñPNV Enthusiasten', active: false },
    { id: 3, name: 'Nachhaltige Mobilit√§t', active: true },
    { id: 4, name: 'E-Bike Community', active: false }
  ]);

  const [posts, setPosts] = useState([
    {
      id: 1,
      username: 'Maria Schmidt',
      profilePic: 'https://via.placeholder.com/50',
      timeAgo: 'vor 2 Stunden',
      content: 'Heute 15km mit dem Fahrrad zur Arbeit! F√ºhlt sich gro√üartig an, den Tag so zu starten üö¥‚Äç‚ôÇÔ∏èüåû',
      likes: 12,
      comments: 4
    },
    {
      id: 2,
      username: 'Thomas Weber',
      profilePic: 'https://via.placeholder.com/50',
      timeAgo: 'vor 1 Stunde',
      content: 'Hat jemand Erfahrung mit der neuen Buslinie 245? √úberlege sie f√ºr meinen Arbeitsweg zu nutzen! üöå',
      likes: 8,
      comments: 6
    }
  ]);

  const handleLike = (postId) => {
    setPosts(posts.map(post => 
      post.id === postId 
        ? { ...post, likes: post.likes + 1 }
        : post
    ));
  };

  const handleComment = (postId) => {
    // Hier k√∂nnte ein Kommentar-Modal ge√∂ffnet werden
    console.log('Kommentar-Funktion f√ºr Post:', postId);
  };

  const handleShare = (postId) => {
    // Hier k√∂nnte ein Teilen-Dialog ge√∂ffnet werden
    console.log('Teilen-Funktion f√ºr Post:', postId);
  };

  const handleCreatePost = () => {
    // Hier k√∂nnte ein Erstellen-Dialog ge√∂ffnet werden
    console.log('Neuen Beitrag erstellen');
  };

  return (
    <div className="community-page">
      <aside className="sidebar">
        <div className="section-title">Freunde</div>
        <div className="friends-list">
          {friends.map(friend => (
            <div key={friend.id} className="friend-item">
              <img src={friend.profilePic} alt={friend.name} className="profile-pic" />
              <span className="username">{friend.name}</span>
            </div>
          ))}
        </div>
      </aside>

      <main className="main-content">
        <div className="create-post">
          <button className="create-post-btn" onClick={handleCreatePost}>Neuen Beitrag erstellen</button>
        </div>

        <div className="activities-feed">
          {posts.map(post => (
            <article key={post.id} className="post">
              <div className="post-header">
                <img src={post.profilePic} alt={post.username} className="profile-pic" />
                <div className="user-info">
                  <div className="username">{post.username}</div>
                  <div className="time-ago">{post.timeAgo}</div>
                </div>
              </div>

              <div className="post-content">{post.content}</div>

              <div className="post-actions">
                <button className="action-button" onClick={() => handleLike(post.id)}>
                  <span>üëç</span> {post.likes} Likes
                </button>
                <button className="action-button" onClick={() => handleComment(post.id)}>
                  <span>üí¨</span> {post.comments} Kommentare
                </button>
                <button className="action-button" onClick={() => handleShare(post.id)}>
                  <span>üì§</span> Teilen
                </button>
              </div>
            </article>
          ))}
        </div>
      </main>

      <aside className="sidebar">
        <div className="section-title">Gruppen</div>
        <div className="groups-list">
          {groups.map(group => (
            <div key={group.id} className="group-item">
              <span className={`status-dot ${group.active ? 'active' : ''}`}></span>
              <span className="group-name">{group.name}</span>
            </div>
          ))}
        </div>
      </aside>
    </div>
  );
};

export default CommunityPage;
